DROP TABLE IF EXISTS `bus_trade`;
CREATE TABLE `bus_trade`  (
  `trade_id` varchar(36) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NOT NULL COMMENT '订单ID',
  `product_id` varchar(36) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '商品ID（外链到需要付款的商品或其他信息）',
