-- ----------------------------
-- Table structure for z_permission
-- ----------------------------
DROP TABLE IF EXISTS `z_permission`;
CREATE TABLE `z_permission`  (
  `permission_id` varchar(36) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NOT NULL COMMENT '资源ID',
  `parent_id` varchar(36) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '父级ID',
  `permission_name` varchar(50) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '资源名称',
  `permission_description` varchar(100) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '资源描述',
  `permission_type` char(1) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '资源类型（0路由1页面资源2外链3其他）',
  `permission_title` varchar(50) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '资源标题',
  `permission_icon` varchar(50) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '资源图标',
  `permission_router` varchar(800) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '资源标记（路由/外链/标记）',
  `permission_component` varchar(200) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '组件地址',
  `permission_config` varchar(500) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '自定义配置（JSON）',
  `permission_is_show` tinyint(1) NULL DEFAULT 1 COMMENT '是否可见（0隐藏1显示）',
  `permission_is_enabled` tinyint(1) NULL DEFAULT 1 COMMENT '是否禁用（0禁用1启用）',
  `no_redirect` varchar(20) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT 'noRedirect' COMMENT '=noRedirect时,在面包屑导航不可点击',
  `no_cache` tinyint(1) NULL DEFAULT 0 COMMENT '默认false,为true时不被<keep-alive>缓存',
  `breadcrumb` tinyint(1) NULL DEFAULT 1 COMMENT '默认true,为false时不在面包屑中显示',
  `affix` tinyint(1) NULL DEFAULT 0 COMMENT '默认false,为true时固定在标签里',
  `active_menu` varchar(200) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '本路由hidden时，菜单栏高亮显示的路由',
  `permission_order` int(11) NULL DEFAULT NULL COMMENT '资源顺序',
  `create_time` datetime(0) NULL DEFAULT NULL COMMENT '创建时间',
  `update_time` datetime(0) NULL DEFAULT NULL COMMENT '最后更新时间',
  PRIMARY KEY (`permission_id`) USING BTREE
) ENGINE = InnoDB CHARACTER SET = utf8mb4 COLLATE = utf8mb4_general_ci COMMENT = '资源权限表' ROW_FORMAT = Dynamic;

