-- ----------------------------
-- Table structure for z_safety
-- ----------------------------
DROP TABLE IF EXISTS `z_safety`;
CREATE TABLE `z_safety`  (
  `id` int(11) NOT NULL COMMENT '配置ID',
  `start_length` smallint(2) NOT NULL DEFAULT 0 COMMENT '开始长度',
  `end_length` smallint(2) NOT NULL DEFAULT 0 COMMENT '结束长度',
  `lowercase` smallint(2) NOT NULL DEFAULT 0 COMMENT '小写字母 0必须无 1必须有 2可有可无',
  `uppercase` smallint(2) NOT NULL DEFAULT 0 COMMENT '大写字母 0必须无 1必须有 2可有可无',
  `numbers` smallint(2) NOT NULL DEFAULT 0 COMMENT '数字 0必须无 1必须有 2可有可无',
  `special_characters` smallint(2) NOT NULL DEFAULT 0 COMMENT '是否有特殊字符 0必须无 1必须有 2可有可无',
  `ban_username` smallint(2) NOT NULL DEFAULT 0 COMMENT '不能包含用户名 0否 1是',
  `valid_time` smallint(6) NOT NULL DEFAULT 0 COMMENT '有效时间 天',
  `prompt` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NOT NULL COMMENT '提示语',
  `login_failed_times` smallint(6) NOT NULL DEFAULT 0 COMMENT '登录失败限制次数（0不限制）',
  `lock_time` smallint(6) NOT NULL DEFAULT 0 COMMENT '锁定时间 分钟（0永久锁定）',
  `default_password` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NOT NULL COMMENT '默认密码',
  `update_time` datetime(0) NULL DEFAULT NULL COMMENT '修改时间',
  PRIMARY KEY (`id`) USING BTREE
) ENGINE = InnoDB CHARACTER SET = utf8mb4 COLLATE = utf8mb4_general_ci COMMENT = '密码安全等设置' ROW_FORMAT = Dynamic;

