INSERT INTO `demo_news` VALUES ('d24bc7d3-2cec-46fe-8af1-a2c4a188b5e9', 'ww及新时代推动中部地区崛起座谈会精神，研究部署道县学习', '&lt;p style=\"text-indent: 2em; text-align: justify;\"&gt;&lt;strong&gt;今日永州讯（通讯员 何玲）&lt;/strong&gt;3月24日下午，道县2024年第7次县委常委会会议召开，传达学习习近平总书记在湖南考察时的重要讲话和指示精神以及新时代推动中部地区崛起座谈会精神，研究部署道县学习宣传贯彻的初步安排和意见。县委书记李天明主持并讲话。&lt;/p&gt;&lt;p style=\"text-align: justify;\"&gt;&lt;img src=\"https://picture.hn0746.com/mam/6600d0d8e4b024a6dd9c2cd7.jpg\" alt=\"\" data-href=\"\" style=\"\"&gt;&lt;/p&gt;&lt;p style=\"text-indent: 2em; text-align: justify;\"&gt;会议指出，习近平总书记考察期间发表的系列重要讲话和指示，与党的十八大以来习近平总书记关于湖南工作的重要讲话和指示批示精神既一脉相承又与时俱进，与习近平总书记2020年来湘考察时为湖南描绘的&ldquo;三高四新&rdquo;美好蓝图有机衔接，反映了习近&lt;/p&gt;', 2, '2024-03-25 11:23:31', '2024-07-04 14:06:59');
